import React from "react";
import Header  from "./Header";
import emoji from './emojipedia';





function App() {
  return (
    <div>
    <Header />

    <div>
      <span className="span">{emoji.emoji}</span>
      <dt>{emoji.name}</dt>
      <dd>{emoji.meaning}</dd>
    </div>

    </div>
  )
}

export default App;
